  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset contains the Fiscal Year 2015
  operations budget with historical and proposed appropriations for state budgeted
  entities by line item. The file is provided by the Governoru2019s Office of Management
  and Budget and is available at the following websites: Budget.Illinois.gov or http://www.state.il.us/budget/).nnThe
  first twelve (12) columns contain the appropriation code, the agency number designator,
  the agency name, the agency division name, the appropriation name, the appropriation
  number, the fund from which the appropriation is made, the fund number, the fund
  category, the appropriation type, and whether or not the appropriation is capital
  expenditure.nnThe remaining columns contain the appropriation amounts ($ thousands)
  for fiscal years 2013 and 2014, and recommended and not recommended appropriations
  for fiscal year 2015.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
